script: |
  super -f text -I q7568.spq | sort > q7568.out

inputs:
  - name: q7568.spq
    data: |
      SELECT + col1 AS col1 FROM tab2 (FORMAT parquet) WHERE - ( + col0 ) NOT BETWEEN 87 AND - col1 + + CAST ( NULL AS INTEGER );
  - name: tab2

outputs:
  - name: q7568.out
    data: |
      51
      67
      77
